import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './App.css'; // Import global styles

// Import components and pages from their subfolders
import Navbar from './components/Navbar';
import HomePage from './page/HomePage';
import ProviderListPage from './pages/ProviderListPage';
import ProviderProfilePage from './pages/ProviderProfilePage';

function App() {
  return (
    <div className="App">
      {/* Navbar will show on every page */}
      <Navbar />

      {/* Main content area where pages will be swapped */}
      <main>
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/providers" element={<ProviderListPage />} />
          <Route path="/providers/:id" element={<ProviderProfilePage />} />

          {/* You can add your login routes here later */}
          {/* <Route path="/login" element={...} /> */}
          {/* <Route path="/provider-login" element={...} /> */}
        </Routes>
      </main>
    </div>
  );
}

// This is the default export that index.js was looking for
export default App;
